import React, { Component } from "react";

class Form extends Component {
  render() {
    return (
      <div className="form">
        <form>
          <input type="text" />
          <input type="text" />
          <input type="text" />
          <textarea />
        </form>
      </div>
    );
  }
}

export default Form;
